  [],\n\t\"num_tags\": 5,\n\t\"name\": \"the-capture-of-alaskan-bald-eagles-for-translocation-to-new-york-and-related-productivity-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In July 1981, the New York State Department
  of Environmental Conservation (DEC) translocated 21 young bald eagles from southeast
  Alaska to historic bald eagle habitat in western New York. This marked the first
  of several years in which young eagles from Alaska would be released in New York
  in an effort to reestablish a viable nesting population. The Alaska portion of the
  1982 project proceeded in a similar manner as the previous year (Cain and Hodges
  1981) with a few important changes. The purpose of this report is to note any changes
  in the implementation of the project in 1982, accurately document all nesting territories
  affected by the removal of eaglets from nests, present productivity data acquired
  during associated surveys, and compare 1981 and 1982 productivity in the study area.\",\n\t\"owner_org\":
